
CREATE table sources(
   source_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
   source_name VARCHAR(500) NOT NULL,
   source_type ENUM('webpage', 'email'),
   created TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
);
   
CREATE UNIQUE INDEX idx_sources ON sources(source_name);
   
CREATE table source_checks(
   check_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
   source_id INT,
   last_checked TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
   disposition ENUM('viewed', 'inquired', 'received'),
   CONSTRAINT fk_source FOREIGN KEY (source_id) REFERENCES sources(source_id)
);

CREATE table downloads(
   download_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
   download_ref VARCHAR(16),
   source_id INT,
   check_id INT,
   checksum CHAR(32),
   raw_key VARCHAR(500),
   original_filename VARCHAR(500),
   created TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
   CONSTRAINT fk_dl_source FOREIGN KEY (source_id) REFERENCES sources(source_id),
   CONSTRAINT fk_check FOREIGN KEY (check_id) REFERENCES source_checks(check_id)
);

CREATE UNIQUE INDEX idx_checksum ON downloads(checksum);
CREATE INDEX idx_dl_ref ON downloads(download_ref);
CREATE INDEX idx_dl_srcid ON downloads(source_id);
CREATE INDEX idx_dl_chkid ON downloads(check_id);

CREATE table summary_levels(
   sumlev CHAR(3) NOT NULL PRIMARY KEY,
   level_name VARCHAR(255)
);

CREATE table geographic_identifiers(
   geoid VARCHAR(7) NOT NULL PRIMARY KEY,
   geoname VARCHAR(255),
   sumlev CHAR(3),
   CONSTRAINT fk_sumlev FOREIGN KEY (sumlev) REFERENCES summary_levels(sumlev)
);

CREATE INDEX idx_geoid_sumlev ON geographic_identifiers(sumlev);

CREATE table products(
   product_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
   download_id INT,
   product_ref VARCHAR(16),
   individual_ref VARCHAR(16),
   product_type ENUM('ndgeojson', 'shp', 'gdb', 'geojson', 'gpkg', 'pbf'),
   product_origin ENUM('original', 'derived'),
   geoid VARCHAR(7),
   product_key VARCHAR(500),
   created TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
   CONSTRAINT fk_geoid FOREIGN KEY (geoid) REFERENCES geographic_identifiers(geoid),
   CONSTRAINT fk_dl_id FOREIGN KEY (download_id) REFERENCES downloads(download_id)
);

CREATE INDEX idx_pr_ref ON products(product_ref);
CREATE INDEX idx_pr_geoid ON products(geoid);
CREATE INDEX idx_pr_dlid ON products(download_id);

CREATE table logfiles(
   logfile_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
   product_id INT,
   message_id VARCHAR(100),
   message_body TEXT,
   message_type ENUM('inbox', 'sort', 'product'),
   created TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
   CONSTRAINT fk_prod_id FOREIGN KEY (product_id) REFERENCES products(product_id)
)

CREATE INDEX idx_msg_id ON logfiles(message_id);




 







